sqlx-ts supports following type generations and other SQL syntax will be ignored from type generation SELECT statements INSERT statements UPDATE statements DELETE statements Also type generation supports parameterised query as per the requirements of PREPARE statements of the databases that sqlx-ts currently supports. MySQL PREPARE Postgres PREPARE Database Parameterised Query Example MySQL ? SELECT * FROM items WHERE points > ? AND points < ? Postgres $1 $2 $3 SELECT * FROM items WHERE points > $1 AND points < $2 in your codebase, if you have the following SQL query const simpleQuery = sql`
SELECT *
FROM items
WHERE points > ?
AND points < ?
` by running sqlx-ts type generation against the query, it would generate export type ISimpleQueryParams = [number, number] export interface ISimpleQueryResult { id: string points: number
} export interface ISimpleQueryQuery{ params: ISimpleQueryParams; result: ISimpleQueryResult;
} sqlx-ts will pick up name of the variable and use it when generating the type definitions. You can override the type name by setting the @name annotation, you can read more in the section below .

